import './App.css';
import Header from './components/Header/Header';
import MainNav from './components/MainNav';
import { Container } from "@material-ui/core";


function App() {
  return (
    <BrowserRouter>
     <Header/>
    <div className="app">
    <Container>
      movie app
    </Container>
    </div>
    <MainNav />
    </BrowserRouter>
  );
}

export default App;
